import React, { useEffect, useState } from 'react';

function App() {
  const [condition,setCondition] = useState(false);
  const toggle=()=>{
    setCondition(!condition)
  }
  useEffect(()=>{
    console.log(condition);
  })
  return (
    <div className="App">
      <h1>Heath Chang</h1>
      <div>True </div>
      <div>False </div>
      <button onClick={toggle}>Toggle </button>
    </div>
  );
}

export default App;
